'use strict';

var TW = require("re-tailwind/src/TW.bs.js");
var React = require("react");
var Caml_chrome_debugger = require("bs-platform/lib/js/caml_chrome_debugger.js");

function Header(Props) {
  return React.createElement("header", {
              className: TW.make(/* :: */Caml_chrome_debugger.simpleVariant("::", [
                      /* BackgroundColor */Caml_chrome_debugger.variant("BackgroundColor", 33, [/* BgIndigo700 */216]),
                      /* :: */Caml_chrome_debugger.simpleVariant("::", [
                          /* Display */Caml_chrome_debugger.variant("Display", 52, [/* Flex */3]),
                          /* [] */0
                        ])
                    ]))
            }, React.createElement("nav", undefined, "Nav"));
}

var make = Header;

exports.make = make;
